import React from 'react';

class Card extends React.Component {

  render(){
    return (
      <div>
        <div className="image-wrapper" >
         <img className="image" src={this.props.product.image_link} alt={this.props.product.image_link} height="100" width="100"/>
        </div>
        <h3>{this.props.product.name}</h3>
        <p>{this.props.product.brand}</p>
        <strong>${this.props.product.price}</strong>
        <p>{this.props.product.product_link}</p>
      </div>
    )
  }

}

export default Card;
